import {React,useState,useEffect} from 'react';
import './home.css';

export default function Home(){
    const [logged_in_user,setLoggedInUser] = useState(null)
    const [loading,setLoading] = useState(false)

    useEffect(() => {
        setLoading(true)
        setLoggedInUser(JSON.parse(localStorage.getItem("logged_in_user")))
        setTimeout(() => {
            setLoading(false)
        }, 1000);
    },[])
    return(
        <div>
            {
                loading === false ?
                <div>
                    <div className="header d-flex justify-content-between p-3">
                        <div>
                            Challenges
                        </div>
                        <div>
                            {logged_in_user.employee_id}
                            {logged_in_user.employee_name}
                        </div>
                    </div>
                </div> :
                <div>
                    Loading ....
                </div>
            }
        </div>
    )
}
